// ==UserScript==
// @name         WME Revisar Cambios
// @namespace    https://greasyfork.org/es/scripts/367946-wme-revisar-cambios
// @author       Walter-Bravo
// @version      2.3
// @description  Verifica cambios realizados al editor de mapas
// @copyright    2018 Walter-Bravo
// @include      /^https:\/\/(www|beta)\.waze\.com\/(?!user\/)(.{2,6}\/)?editor.*$/
// @icon         data:image/png;base64,
// @grant        none
// ==/UserScript==

(function () {
    console.debug("wme-snapshot: loading snapshot mode...");
    wme_snapshot_bootstrap = function (retry) {
        // script for logged in user
        if (window.Waze && window.Waze.loginManager && window.Waze.loginManager.events.register && window.Waze.map && Waze.loginManager.isLoggedIn()) {
            wme_snapshot_setup();
        } else {
            if (retry > 5) {
                console.error("wme-snapshot: failed to init (wait 5 times 1 second)");
                return;
            }
            console.debug("wme-snapshot: not yet initialized retry #" + retry);
            setTimeout(function () {
                wme_snapshot_bootstrap(retry + 1);
            }, 1000);
        }
    };
    
    wme_snapshot_setup = function() {
        console.debug("wme-snapshot: setup()");
        var topBar = jQuery('.topbar')[0];
        var newDiv = document.createElement('div');
        newDiv.id = "wme_snapshot_toggler";
        newDiv.innerHTML = '<a onclick="snapshotClick()" style="cursor:pointer; color:white; position:absolute; left: 50%; font-family: &quot;Open Sans&quot;,&quot;Alef&quot;,helvetica,sans-serif">Revisar Cambios</a>';
        topBar.appendChild(newDiv);
    };
    
    snapshotClick = function() {
      var isOn = Waze.snapshotManager.isSnapshotOn(); 
      console.debug("wme-snapshot: snapshotClick() isOn=" + isOn);
      if (isOn) {
          jQuery('#wme_snapshot_toggler').show();
      } else {
          Waze.snapshotManager.listenToOnce(Waze.snapshotManager, "change:state change:togglable", snapshotClick);
          Waze.snapshotManager.toggle(true);
          jQuery('#wme_snapshot_toggler').hide();
      }
    }

    // call init method
    wme_snapshot_bootstrap(1);

})();